import React from 'react'
import {logo} from './Logo/react.svg'
const Card = () => {
	return(
		<div>
			<img
				alt='img'
				src= {logo}
			/>
			<div>
				<h2>Jane Doe</h2>
				<p>jane.doe@gmail.com</p>
			</div>
		</div>
	);
}

export default Card;
